import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import styles from './card.module.css'
import projectImage from '../images/projects/blistabloc.png'

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
  media: {
    height: 140,
  },
});

export default function MediaCard(props) {
  const classes = useStyles();
console.log(props)
  return (
<div className={styles.featured-projects}>
<figure className={styles.project_image}>
    <a href="#">
        <img src={projectImage} alt="project logo"/>
    </a>
</figure>
<figcaption class="project_caption">
        <div class="project_name">
          <a href="https://blistabloc.com/" target="_blank">blistabloc</a>
        </div>
        <p>Custom wordpress theme built with Timber and Woocommerce for blistabloc, the only reactive shoe insert that prevents
          blisters from forming.</p>
      </figcaption>
</div>
  );
}
